$_MODULE['<{mbeshipping}prestashop>welcome_83218ac34c1834c26781fe4bde918ee4'] = 'Herzlich willkommen';
$_MODULE['<{mbeshipping}prestashop>welcome_06acb34650df4917a32a707f41eb0994'] = 'Versand und digitalisierte Logistik mit MBE';
$_MODULE['<{mbeshipping}prestashop>welcome_bd279c91483c0fd991bf0dd24082c847'] = 'Geben Sie Ihrem E-Commerce neue Impulse mit MBE-Lösungen zur Digitalisierung von Sendungen und Logistik, konzipiert für Unternehmen, Unternehmer, aber auch Handwerker, die einen zuverlässigen Partner suchen, der sie dabei unterstützt, ihr Geschäft mit umfassenden und flexiblen Lösungen erfolgreich online zu bringen. Sie sind MBE-Kunde?';
$_MODULE['<{mbeshipping}prestashop>welcome_02d4482d332e1aef3437cd61c9bcc624'] = 'Kontaktiere uns';
$_MODULE['<{mbeshipping}prestashop>welcome_ee3ae8f2b909a448403a77ffbb3cb259'] = 'Starten Sie die Konfiguration';
$_MODULE['<{mbeshipping}prestashop>welcome_0d7545e6e62aa27411c09e133edba866'] = 'Indem Sie die MBE-Plattform direkt mit Ihrer E-Commerce-Website verbinden, können Sie die Verwaltung von Sendungen automatisieren und den Verkaufsprozess vereinfachen.';
$_MODULE['<{mbeshipping}prestashop>welcome_461b35b457d9b9ba7ee9b502c377cc30'] = 'MBE Digital Solutions	';
$_MODULE['<{mbeshipping}prestashop>welcome_1bcd51908f4de69964082ee6a92fa697'] = 'Schlüsselfertige digitale Services, die Ihrer Marke zum Durchbruch verhelfen. Erreichen Sie Ihre Kunden online mit digitalen Lösungen und Web-Marketing-Tools, die Ihnen mehr Möglichkeiten bieten, Ihr Publikum zu erreichen, indem Sie eine effektive Online-Präsenz für Ihr Unternehmen aufbauen und dort sind, wo Ihre Kunden sind. MBE bietet Ihnen effektive Lösungen zum Ausbau Ihrer digitalen Kanäle. Präsentieren Sie Ihre Marke, Ihren E-Commerce-Shop oder verbessern Sie Ihre aktuelle Website, um sie in Suchmaschinen besser sichtbar zu machen.';
$_MODULE['<{mbeshipping}prestashop>welcome_47e149951cc16a06badb305ea12b2dd5'] = 'MBE-Verpackung';
$_MODULE['<{mbeshipping}prestashop>welcome_6efcae05527f34189a6799f27c0ae9bd'] = 'Der Verpackungsservice, der Ihrem Unternehmen einen Vorteil verschafft. Ihre Kunden verdienen ein einzigartiges Erlebnis: Überraschen Sie sie beim Auspacken mit individuellen Verpackungslösungen für Ihre Produkte. Eine hochgradig kundenspezifische Lösung, die Ihre Marke aufwertet und einen Hauch von Stil hinzufügt, basierend auf Ihren spezifischen Anforderungen. Neben der Optimierung von Zeit und Ressourcen können Sie Ihre Umweltbelastung reduzieren, da MBE innovative Verpackungstechniken und -materialien verwendet.';
$_MODULE['<{mbeshipping}prestashop>welcome_7f59c0ca6fc8f4127ae2692ca2d363a5'] = 'Jetzt wissen Sie, dass Sie einen zuverlässigen Partner an Ihrer Seite haben!';
$_MODULE['<{mbeshipping}prestashop>welcome_eca6d7ebbb683e1d8ae9813c82ca5228'] = 'MBE ist der richtige End-to-End-Partner, der alle Realitäten beim digitalen Übergang unterstützt, indem er komplette und schlüsselfertige Lösungen bereitstellt.';
